import 'bootstrap/dist/css/bootstrap.css';
import React from 'react';
import ReactDOM from 'react-dom/client';
import "./../styles/pages.css"
import $ from 'jquery';


$('#time').datetimepicker({
    format: 'yyyy-mm-dd'
});


export default class TimePicker extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                <input className="form-control" type="time" id="appt" name="appt" min={this.props.min} max={this.props.min} required></input>
            </div>
        )
    }
}
